import React from 'react';
import {Container, Logo} from './style.js';
import globe from '../../assets/globe.svg'

function LandingPage() {
  return (
    <Container>
      <Logo>
        <img src={globe} alt=""/>
      </Logo>
      <Float>
        <div className="title">
          Face 
          <span>Recognition</span>
        </div>

      </Float>
    </Container>
  );
}

export default LandingPage;
